import React from "react";
import styled from "styled-components";
import { NavLink } from "react-router-dom";

const StyledHeader = styled.header`
	display: flex;
	justify-content: space-between;

	.header-name {
		font-size: 4rem;
		font-family: "Amatic SC", cursive;
		color: #8ebd40;
		padding-left: 3%;
	}

	.nav-links {
		width: 30%;
		display: flex;
		justify-content: space-between;
		align-items: center;
		padding-right: 5%;
	}

	.header-link {
		text-decoration: none;
		color: black;
		font-family: "Amatic SC", cursive;
		font-size: 2rem;
	}

	.demo {
		background-color: #8ebd40;
		color: white;
		width: 10%;
	}
`;

const Header = () => {
	return (
		<StyledHeader>
			<h1 className="header-name">Billy</h1>
			<nav className="nav-links">
				<NavLink className="header-link" to="/">
					About
				</NavLink>
				<NavLink className="header-link" to="/">
					Product
				</NavLink>
				<NavLink className="header-link demo" to="/">
					Demo
				</NavLink>
			</nav>
		</StyledHeader>
	);
};

export default Header;
